script: |
  super -f text -I q5616.spq | sort > q5616.out

inputs:
  - name: q5616.spq
    data: |
      SELECT DISTINCT col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 / 95 NOT IN ( + + col1 + col1 * + 5, - col2, - + col2 * + - 72 - - 35 );
  - name: tab1

outputs:
  - name: q5616.out
    data: |
      51
      85
      91
